package main

import (
	"fmt"
	"net/http"
)

const page = `<!doctype html>
<meta charset=utf-8>
<style>
html{
	background:radial-gradient(#eee, #ccc, #888);
	color:#333;
	font-family:sans-serif;
	height:100%%;
	margin:0;
	padding:0;
}
body{
	margin:50px;
}
#ocelot{
	position:absolute;
	right:50px;
	bottom:50px;
}
#boop{
	position:absolute;
	bottom:50px;
}
#meep{
	position:absolute;
	right:50px;
	top:50px;
}
</style>
<title>hej</title>
<img id=ocelot alt="ocelot, clearly" width="640" height="420" src="data:image/jpg;base64,">
<p>nothing to see here at the moment.<br/>except for the ever so lovely ocelot obviously.</p>
<p><em><small>this page was served with go net/http.</small></em></p>
<div id=meep>meep.</div>
<div id=boop>boop.</div>

<!-- "Inside every cynical person, there is a disappointed idealist." - George Carlin -->`

func writePage(w http.ResponseWriter, r *http.Request) {
	fmt.Fprintf(w, page)
}

func main() {
	http.HandleFunc("/", writePage)
	http.ListenAndServe(":80", nil)
}
